import React from 'react';
import './VisionMissionSection.css';

const VisionMissionSection = () => {
    return (
        <div className="vision-mission-section">
            <div className="overlay">
                <div className="vision-container">
                    <div className="side-line vertical"></div>
                    <div className="content">
                        <h2>Our Vision</h2>
                        <p>To save lives through the provision of safe and adequate blood and blood products, effectively and efficiently to all people in need.</p>
                    </div>
                </div>
                <div className="mission-container">
                    <div className="side-line vertical"></div>
                    <div className="content">
                        <h2>Our Mission</h2>
                        <p>To become the leading provider of safe and adequate blood and blood products, through the implementation of a nationally coordinated blood transfusion service.</p>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default VisionMissionSection;
